import styles from "./Card.module.css";

function Card(props) {
    const {data} = props;

    return(
        <div className={styles.data}>
            <h1 className={styles.pasien__status}>{data.status}</h1>
            <p className={styles[data.status]}>{data.total}</p>
        </div>
    );
}

export default Card;
